window.enableDarkMode = function(themeConfigs) {
	let binaryString = atob(themeConfigs);
	var obj = binaryString && JSON.parse(binaryString) || {};
	if (!obj || !obj.themeOptions) return;
	DarkReader.enable(obj.themeOptions, obj.fixes);
};

DarkReader.setFetchMethod((url) =>{
	return new Promise(function(resolve, reject) {
		window.fetch(url).then(function(response) {
			if (response.ok) {
				resolve(response);
			}
		}).
		catch((error) =>{
			console.log("window fetch error:" + error);
		});
	});
});

